import React, { Component } from 'react';
import {Card, CardContent, Typography, CardActions, Box} from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
  root: {
    maxWidth: 400,
  },
  bullet: {
    display: 'inline-block',
    margin: '0 2px',
    transform: 'scale(0.8)',
  },
  title: {
    fontSize: 14,
  },
  pos: {
    marginBottom: 12,
  },
});



class ProblemCard extends Component {
	render () {
		console.log(this.props)
		return (
			<Card style={{minWidth: 1000, maxWidth: 1000}}>
				<CardContent>
					{this.props.statement}
				</CardContent>
				<CardActions>
					<div style={{fontStyle: "italic", margin: "10pt"}}>
					{Date(this.props.date_created.seconds)}
					</div>
				</CardActions>
			</Card>
		);
	}
}

export default ProblemCard
